se,"start_time":"2023-11-29T03:10:48.549635","status":"completed"},"tags":[]},"source":["Al analizar los resultados del resumen de las estadísticas del modelo podemos observar que el valor del intercepto es de -1,  lo que representa el valor esperado de la variable dependiente (caminata aleatoria) cuando el tiempo es cero.\n","\n","Adicionalmente si tomamos en cuenta que el valor de la pendiente de la recta del modelo de regresión lineal es el coeficiente asociado a la variable independiente, entonces esperamos que el tiempo cambie en 0.134 unidades cuando la variable **rwalk** cambia en 1 unidad.\n","\n","Finalmente para obtener la ecuación de la recta de regresión lineal podemos utilizar la fórmula general *y = mx + b*, donde:\n","* y es la variable dependiente,\n","* x es la variable independiente,\n","* m es la pendiente de la línea, y\n","* b es la intercepción en el eje y.\n","\n","Al reemplazar los valores obtenemos la siguiente ecuación:\n","\n","## *y = 0.134x + -1*\n","\n","Esta ecuación se puede utilizar para hacer prediciones futuras sobre el valor de la caminata aleatoria en función del tiempo."]},{"cell_type":"markdown","id":"c5673c68","metadata":{"papermill":{"duration":0.015453,"end_time":"2023-11-29T03:10:48.592824","exception":false,"start_time":"2023-11-29T03:10:48.577371","status":"completed"},"tags":[]},"source":["## Graficar el modelo de regresión lineal"]},{"cell_type":"code","execution_count":8,"id":"a308503c","metadata":{"execution":{"iopub.execute_input":"2023-11-29T03:10:48.62649Z","iopub.status.busy":"2023-11-29T03:10:48.623538Z","iopub.status.idle":"2023-11-29T03:10:48.773511Z","shell.execute_reply":"2023-11-29T03:10:48.769989Z"},"papermill":{"duration":0.170484,"end_time":"2023-11-29T03:10:48.777183","exception":false,"start_time":"2023-11-29T03:10:48.606699","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd0BTZ9sG8DsJe0MCKjhq3QsXKm5w